import React, { useState } from 'react';
import SearchLogic from './SearchLogic';

function App() {
  // Define searchResults state
  const [searchResults, setSearchResults] = useState([]);

  // Function to add items to searchResults
  const handleSearch = () => {
    // Fetch search results data or generate it
    const newResults = [
      { id: 1, title: 'Search Result 1' },
      { id: 2, title: 'Search Result 2' },
      { id: 3, title: 'Search Result 3' },
    ];

    // Set searchResults state with new results
    setSearchResults(newResults);
  };

  return (
    <div className="App">
      {/* Button to trigger search */}
      <button onClick={handleSearch}>Search</button>
      {/* Render SearchLogic component with searchResults */}
      <SearchLogic searchResults={searchResults} />
    </div>
  );
}

export default App;
